import React from "react";
import { propTypes } from "react-bootstrap/esm/Image";

const MovieList = (props) => {
    return(
        <>
            {props.movies.map((movie, index)=> (
                <div>
                    <img src={movie.poster} alt="movie" key={movie.imdbID}></img>
                </div>
            ))}
        </>
    );
};

export default MovieList;
